import { useState } from 'react';
import { Search, Grid, List, ChevronDown } from 'lucide-react';
import Header from '../components/Header';
import PlayerCard from '../components/PlayerCard';
import SearchBar from '../components/SearchBar';
import { players } from '../data/players';

const MainPage = ({ navigateToPage }) => {
  const [searchTerm, setSearchTerm] = useState('');
  const [selectedTeam, setSelectedTeam] = useState('all');
  const [ageRange, setAgeRange] = useState('all');

  const filteredPlayers = players.filter(player => {
    const matchesSearch = player.name.toLowerCase().includes(searchTerm.toLowerCase()) ||
                         player.team.toLowerCase().includes(searchTerm.toLowerCase());
    const matchesTeam = selectedTeam === 'all' || player.team === selectedTeam;
    const matchesAge = ageRange === 'all' || 
                      (ageRange === 'young' && player.age < 25) ||
                      (ageRange === 'old' && player.age >= 25);

    return matchesSearch && matchesTeam && matchesAge;
  });

  return (
    <div className="min-h-screen flex">
      <Header navigateToPage={navigateToPage} />
      <div className="flex-1 p-6">
        <div className="flex justify-between items-center mb-6">
          <h1 className="text-xl font-bold">أفضل الحراس</h1>
          <div className="flex space-x-2 space-x-reverse">
            <input
              type="text"
              placeholder="البحث عن لاعب..."
              className="outline-none bg-transparent w-40 border rounded-md p-2"
              value={searchTerm}
              onChange={(e) => setSearchTerm(e.target.value)}
            />
            <select
              className="border rounded-md p-2"
              value={selectedTeam}
              onChange={(e) => setSelectedTeam(e.target.value)}
            >
              <option value="all">جميع الأندية</option>
              <option value="النصر">النصر</option>
              <option value="الهلال">الهلال</option>
              <option value="الاتحاد">الاتحاد</option>
            </select>
            <select
              className="border rounded-md p-2"
              value={ageRange}
              onChange={(e) => setAgeRange(e.target.value)}
            >
              <option value="all">جميع الأعمار</option>
              <option value="young">أقل من 25</option>
              <option value="old">25 وأكثر</option>
            </select>
          </div>
        </div>

        <div className="grid grid-cols-3 gap-6">
          {filteredPlayers.map((player) => (
            <PlayerCard
              key={player.id}
              player={player}
              onClick={() => navigateToPage('playerDetails', player)}
            />
          ))}
        </div>
      </div>

      <div className="w-1/4 p-6 bg-gray-100">
        <h2 className="text-lg font-bold mb-4">أفضل الحراس</h2>
        <ul>
          {players.slice(0, 5).map((player) => (
            <li key={player.id} className="mb-2">
              <div className="flex items-center">
                <img src={player.image} alt={player.name} className="w-8 h-8 rounded-full mr-2" />
                <div>
                  <div className="font-bold">{player.name}</div>
                  <div className="text-sm text-gray-500">{player.team}</div>
                </div>
                <div className="ml-auto bg-green-100 px-2 py-1 rounded text-xs text-green-800">{player.successRate}%</div>
              </div>
            </li>
          ))}
        </ul>

        <h2 className="text-lg font-bold mt-8 mb-4">آخر المباريات</h2>
        <ul>
          {Array(5).fill().map((_, i) => (
            <li key={i} className="mb-2">
              <div className="flex justify-between items-center">
                <div>الهلال vs النصر</div>
                <div className="text-gray-400">2:1</div>
              </div>
              <div className="text-sm text-green-500">4 تصويبات</div>
            </li>
          ))}
        </ul>
      </div>
    </div>
  );
};

export default MainPage;
